import React from "react";
import "../Components/Main.css";
import logo from "../img/104.png";
import Background from '../img/background.png'; 

const Main = () => {
  return (
    <>
      <div className="container-fluid Main_Background">
        <div className="row ">
          <img src={Background} />
          <div className="Main_dev1">
            <span className="">Yoga for Flat Abs</span>
            <br />
            <span className="Main_dev2">90 Day Program</span>
          </div>
        </div>
        <div className="Main_video">
          <img src={logo} alt="Logo" className="mediadiv" />
        </div>
      </div>
    </>
  );
};

export default Main;
